export let WheelPickerAlign;
(function (WheelPickerAlign) {
  WheelPickerAlign["CENTER"] = "center";
  WheelPickerAlign["RIGHT"] = "right";
  WheelPickerAlign["LEFT"] = "left";
})(WheelPickerAlign || (WheelPickerAlign = {}));
